u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"10419","type":"Paragraph"},{"attributes":{"text":"Letalidade = 2.4511%"},"id":"10412","type":"Paragraph"},{"attributes":{},"id":"10476","type":"BasicTickFormatter"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"9332","type":"BoxAnnotation"},{"attributes":{"text":"Casos Novos = 991.0000"},"id":"10410","type":"Paragraph"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"10052"},{"id":"10053"},{"id":"10054"},{"id":"10055"},{"id":"10056"},{"id":"10057"},{"id":"10078"}]},"id":"10059","type":"Toolbar"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"10340","type":"BoxAnnotation"},{"attributes":{"data_source":{"id":"10113"},"glyph":{"id":"10114"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"10115"},"selection_glyph":null,"view":{"id":"10117"}},"id":"10116","type":"GlyphRenderer"},{"attributes":{"text":"Evolu\u00e7\u00e3o da Mortalidade no Estado do Maranh\u00e3o"},"id":"10081","type":"Title"},{"attributes":{},"id":"10477","type":"DatetimeTickFormatter"},{"attributes":{"axis":{"id":"10095"},"dimension":1,"ticker":null},"id":"10098","type":"Grid"},{"attributes":{},"id":"10100","type":"WheelZoomTool"},{"attributes":{},"id":"10104","type":"HelpTool"},{"attributes":{"overlay":{"id":"10105"}},"id":"10101","type
